import React, { Component } from 'react'

import ItemTable from './ItemTable/ItemTable';


class Table extends Component {

  constructor(props) {
    super(props);

    this.state = {};
    this.state.items = [
      {
        heading: 'Item',
        inputType: 'Select'
      },
      {
        heading: 'Material Fee',
        inputType: 'currency'
      },
      {
        heading: 'Packing Fee',
        inputType: 'currency'
      },
      {
        heading: 'Unpacking Fee',
        inputType: 'currency'
      },
    ]
  }

 

  render() {

    return (
      <>
          <ItemTable  items={this.state.items} />     
      </>
    );

  }

}

export default Table;
